package main

import (
	"testing"
)

func TestGetHackAssembler(t *testing.T) {
	assembler := GetHackAssembler()
	AssertNotNull(t, assembler)
}

func TestHackAssembler_Assemble(t *testing.T) {
	AssertEqualsString(t, addHack, GetHackAssembler().Assemble(addAssembly))
	AssertEqualsString(t, maxHack, GetHackAssembler().Assemble(maxAssembly))
	AssertEqualsString(t, maxLHack, GetHackAssembler().Assemble(maxLAssembly))
	AssertEqualsString(t, rectHack, GetHackAssembler().Assemble(rectAssembly))
	AssertEqualsString(t, rectLHack, GetHackAssembler().Assemble(rectLAssembly))
	AssertEqualsString(t, pongHack, GetHackAssembler().Assemble(pongAssembly))
	AssertEqualsString(t, pongLHack, GetHackAssembler().Assemble(pongLAssembly))
}

